import httpService from './axios.js'
import Qs from 'qs';

const post = function post(url, pargrams) {
	return httpService({
		url: url,
		method: 'post',
		data: Qs.stringify(pargrams)
	})
}


const get = function get(url, pargrams) {
	return httpService({
		url: url,
		method: 'get',
		data: Qs.stringify(pargrams)
	})
}

export default http;
